import React from "react";
import "./Stickers.css";

const StudentChoice = props => {
  return (
    <div key={props.key}>
      <button>
        <img src={props.src} alt={props.alt} onClick={props.onClick} />
      </button>
    </div>
  );
};

export default StudentChoice;
